export function getImgList({srcsetParse:srcsetParse}){const r={urls:[],title:""};for(var dom of document.querySelectorAll(".kijibox p"))dom.querySelector("img")&&dom.querySelector("img").srcset&&r.urls.push(dom.querySelector("img").srcset);if(r.urls=srcsetParse(r.urls),!r.urls.length)for(var dom of document.querySelectorAll(".kijibox p"))dom.querySelector("a")&&dom.querySelector("a").href&&r.urls.push(dom.querySelector("a").href);return r.title="eromanga-cafe-"+location.href.split(/\.|\//)[4],r}